    try {
      const response = await axiosInstance.get('/api/usuarios');
      console.log('Dados recebidos:', response.data);
    } catch (error) {
      console.error('Error:', error);
    }
  }*/


  return (
    <div className="App">
      <Router>
      <div className="App">
        <h1>Hello World</h1>

        {/* Botão de navegação */}
        <button>
          <Link to="/outra-pagina">Ir para outra página</Link>
        </button>

        {/* Definindo as rotas */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/criar-conta" element={<CriarConta />} />
        </Routes>
      </div>
      </Router>
    </div>
  );

  function CriarConta(){
    return <h2>Criar Conta</h2>
  }
}

export default App;
